num = int(input("Cantidad de formularios a generar"))

# Establecer conexion
con = pika.BlockingConnection(pika.ConnectionParameters(host='localhost'))
ch = con.channel()

# Declarar la cola
ch.queue_declare(queue='formularios')

# Generar un trabajo

for i in range(1,num+1):

    data = getDatosFormulario(randint(1,100))

